import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { FaGithub, FaExternalLinkAlt, FaImages, FaTimes, FaChevronLeft, FaChevronRight, FaDownload, FaEye } from 'react-icons/fa';

const projects = [
  {
    title: 'Hospital Database System',
    description: 'A comprehensive database management system for hospitals, featuring patient records, staff management, and appointment scheduling. Built with C# and SQL, this project demonstrates strong database design and management skills.',
    technologies: ['C#', 'SQL', 'Entity Framework', 'Windows Forms'],
    githubLink: null,
    liveLink: null,
    image: '/images/3rd Nominal Form.png',
    screenshots: '/Hospital-DB-Project.pdf',
  },
  {
    title: 'Create Your Own Adventure Game',
    description: 'An interactive text-based adventure game where players make choices that affect the story outcome. This project showcases strong programming logic and user interface design skills.',
    technologies: ['C#', 'Windows Forms', 'Object-Oriented Programming'],
    githubLink: 'https://github.com/MLWester/Create-Your-Own-Adventure-Game',
    liveLink: null,
    image: '/images/CYOA Class Diagram.png',
    screenshots: [
      '/images/CYOA Class Diagram.png',
      '/images/CYOA Create Charcter Activity Diagram.png',
      '/images/CYOA Attack Diagram.png',
      '/images/CYOA End Game Diagram.png',
      '/images/CYOA Sequence Diagram.png',
      '/images/CYOA Start Diagram.png'
    ],
  },
  {
    title: 'FitPro Gym Management',
    description: 'A gym management system designed to handle member registrations, class scheduling, and facility management. This project demonstrates full-stack development capabilities and database integration.',
    technologies: ['C#', 'SQL', 'Entity Framework', 'Windows Forms'],
    githubLink: 'https://github.com/MLWester/FitPro-Gym-Membership-Manager',
    liveLink: '/FitPro-Demo-Vid.mp4',
    image: '/images/fitpro 5.png',
    screenshots: [
      '/images/fitpro 5.png',
      '/images/fitpro 4.png',
      '/images/fitpro 3.png',
      '/images/fitpro 2.png',
      '/images/Fitpro 1.png'
    ],
  },
  {
    title: 'Project 4',
    description: 'Coming soon...',
    technologies: [],
    githubLink: '#',
    liveLink: '#',
    image: '/images/placeholder.jpg',
    screenshots: '#',
  },
];

const Projects = () => {
  const [selectedProject, setSelectedProject] = useState(null);
  const [currentImageIndex, setCurrentImageIndex] = useState(0);

  const openModal = (project) => {
    setSelectedProject(project);
    setCurrentImageIndex(0);
  };

  const closeModal = () => {
    setSelectedProject(null);
  };

  const nextImage = () => {
    if (selectedProject && Array.isArray(selectedProject.screenshots)) {
      setCurrentImageIndex((prevIndex) => 
        (prevIndex + 1) % selectedProject.screenshots.length
      );
    }
  };

  const prevImage = () => {
    if (selectedProject && Array.isArray(selectedProject.screenshots)) {
      setCurrentImageIndex((prevIndex) => 
        (prevIndex - 1 + selectedProject.screenshots.length) % selectedProject.screenshots.length
      );
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-gray-900 to-black py-16 px-4 sm:px-6 lg:px-8">
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        className="max-w-7xl mx-auto"
      >
        <motion.h1
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.2 }}
          className="text-5xl font-bold text-center mb-16 bg-clip-text text-transparent bg-gradient-to-r from-blue-400 to-purple-600"
        >
          My <span className="text-accent">Projects</span>
        </motion.h1>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-12">
          {projects.map((project, index) => (
            <motion.div
              key={project.title}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: index * 0.1 }}
              whileHover={{ scale: 1.02 }}
              className="bg-gray-800 rounded-xl overflow-hidden shadow-2xl transform transition-all duration-300 hover:shadow-purple-500/20"
            >
              <div className="relative h-64 overflow-hidden">
                <motion.img
                  src={project.image}
                  alt={project.title}
                  className="w-full h-full object-cover transform transition-transform duration-500 hover:scale-110"
                  whileHover={{ scale: 1.1 }}
                />
                <div className="absolute inset-0 bg-gradient-to-t from-gray-900/80 to-transparent" />
              </div>
              
              <div className="p-8">
                <motion.h2 
                  className="text-2xl font-bold mb-4 text-white"
                  whileHover={{ color: '#8B5CF6' }}
                >
                  {project.title}
                </motion.h2>
                
                <p className="text-gray-300 mb-6 leading-relaxed">
                  {project.description}
                </p>
                
                <div className="flex flex-wrap gap-2 mb-6">
                  {project.technologies.map((tech) => (
                    <motion.span
                      key={tech}
                      className="bg-gradient-to-r from-purple-600 to-blue-600 text-white text-sm px-4 py-2 rounded-full"
                      whileHover={{ scale: 1.05 }}
                    >
                      {tech}
                    </motion.span>
                  ))}
                </div>

                <div className="flex flex-wrap gap-4">
                  {project.githubLink && (
                    <motion.a
                      href={project.githubLink}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="bg-gray-700 hover:bg-gray-600 text-white font-bold py-3 px-6 rounded-lg flex items-center space-x-2 transition duration-300 hover:shadow-lg hover:shadow-purple-500/20"
                      whileHover={{ scale: 1.05 }}
                    >
                      <FaGithub />
                      <span>Source Code</span>
                    </motion.a>
                  )}
                  
                  {project.liveLink && (
                    <motion.a
                      href={project.liveLink}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="bg-gradient-to-r from-purple-600 to-blue-600 hover:from-purple-700 hover:to-blue-700 text-white font-bold py-3 px-6 rounded-lg flex items-center space-x-2 transition duration-300 hover:shadow-lg hover:shadow-purple-500/20"
                      whileHover={{ scale: 1.05 }}
                    >
                      <FaExternalLinkAlt />
                      <span>Live Demo</span>
                    </motion.a>
                  )}

                  {Array.isArray(project.screenshots) ? (
                    <motion.button
                      onClick={() => openModal(project)}
                      className="bg-gray-700 hover:bg-gray-600 text-white font-bold py-3 px-6 rounded-lg flex items-center space-x-2 transition duration-300 hover:shadow-lg hover:shadow-purple-500/20"
                      whileHover={{ scale: 1.05 }}
                    >
                      <FaImages />
                      <span>View Screenshots ({project.screenshots.length})</span>
                    </motion.button>
                  ) : (
                    <>
                      <motion.a
                        href={project.screenshots}
                        target="_blank"
                        rel="noopener noreferrer"
                        className="bg-gray-700 hover:bg-gray-600 text-white font-bold py-3 px-6 rounded-lg flex items-center space-x-2 transition duration-300 hover:shadow-lg hover:shadow-purple-500/20"
                        whileHover={{ scale: 1.05 }}
                      >
                        <FaEye />
                        <span>View Documentation</span>
                      </motion.a>
                      <motion.a
                        href={project.screenshots}
                        download="Hospital-DB-Project.pdf"
                        className="bg-gradient-to-r from-purple-600 to-blue-600 hover:from-purple-700 hover:to-blue-700 text-white font-bold py-3 px-6 rounded-lg flex items-center space-x-2 transition duration-300 hover:shadow-lg hover:shadow-purple-500/20"
                        whileHover={{ scale: 1.05 }}
                      >
                        <FaDownload />
                        <span>Download Documentation</span>
                      </motion.a>
                    </>
                  )}
                </div>
              </div>
            </motion.div>
          ))}
        </div>
      </motion.div>

      {/* Modal for screenshots */}
      {selectedProject && Array.isArray(selectedProject.screenshots) && (
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          exit={{ opacity: 0 }}
          className="fixed inset-0 bg-black/90 backdrop-blur-sm flex items-center justify-center z-50 p-4"
        >
          <motion.div
            initial={{ scale: 0.9, opacity: 0 }}
            animate={{ scale: 1, opacity: 1 }}
            exit={{ scale: 0.9, opacity: 0 }}
            className="bg-gray-800 rounded-xl p-6 max-w-4xl w-full mx-4 shadow-2xl"
          >
            <div className="flex justify-between items-center mb-6">
              <h3 className="text-2xl font-bold text-white">{selectedProject.title} Screenshots</h3>
              <motion.button
                onClick={closeModal}
                className="text-white hover:text-purple-400 transition-colors p-2 rounded-full hover:bg-gray-700"
                whileHover={{ scale: 1.1 }}
              >
                <FaTimes size={24} />
              </motion.button>
            </div>
            
            <div className="relative">
              <motion.img
                key={currentImageIndex}
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                exit={{ opacity: 0 }}
                src={selectedProject.screenshots[currentImageIndex]}
                alt={`Screenshot ${currentImageIndex + 1}`}
                className="w-full h-auto rounded-lg shadow-xl"
              />
              <motion.button
                onClick={prevImage}
                className="absolute left-4 top-1/2 transform -translate-y-1/2 bg-black/50 text-white p-3 rounded-full hover:bg-black/75 transition-colors"
                whileHover={{ scale: 1.1 }}
              >
                <FaChevronLeft size={24} />
              </motion.button>
              <motion.button
                onClick={nextImage}
                className="absolute right-4 top-1/2 transform -translate-y-1/2 bg-black/50 text-white p-3 rounded-full hover:bg-black/75 transition-colors"
                whileHover={{ scale: 1.1 }}
              >
                <FaChevronRight size={24} />
              </motion.button>
            </div>
            
            <div className="mt-6 text-center text-white text-lg">
              Image {currentImageIndex + 1} of {selectedProject.screenshots.length}
            </div>
          </motion.div>
        </motion.div>
      )}
    </div>
  );
};

export default Projects;
